import React from "react";
import PropTypes from "prop-types"

function Box(props){

    return (
        <>
            <div onClick={props.handleClick}> I have returned with {props.value} {props.fruit}{props.value !== 1 && "s"}  </div>
        </>
    )
}

export default Box;
